import "./NavBar.css"
import React, { Component } from 'react';


 export class Navbar1 extends Component {
  state={clicked:false}
  render() {
    return(
    <nav>
      <h1>React<i className="fab fa-react"></i></h1>
      <div className="icons" onClick={this.handleClick}>
        <i className={this.state.clicked ?'fa fa-times' : 'fas fa-bars'}></i>
        </div>
        <ul className="list">
            <li className="items">SignIn</li>
            <li className="items">SignOut</li>
            <li className="items">Support</li>
        </ul>
    </nav>
    )  
}
}
